"use strict";

//页面跳转
(function () {
	var Wallet = {
		init: function init() {
			//页面跳转
			this.turnUrl(".e-setup", "setup.html", "setup");
			this.turnUrl(".e-import", "importwallet.html", "importwallet");
		},
		turnUrl: function turnUrl(elements, url, id) {
			$(elements).on('tap', function () {
				openInfo(url, id);
			});
		}
	};
	Wallet.init();
})();